import React from "react";
import { MainPage } from "./main_page/MainPage";
import { BrowserRouter, Route, Routes, useLocation } from "react-router-dom";
import { ColourManagement } from "./colour/ColourManagement";
import { AddColour } from "./colour/AddColour";
import { ProductGroupManagement } from "./product/ProductGroupManagement";
import { ProductManagement } from "./product/ProductManagement";
import { BrandsManagement } from "./brand/BrandsManagement";
import { GuaranteeManagement } from "./guarantee/GuaranteeManagement";
import { DiscountManagement } from "./discount/DiscountManagement";
import { CardsManagement } from "./card/CardsManagement";
import { OrdersManagement } from "./order/OrdersManagement";
import { SendManagement } from "./how_yo_send/SendManagement";
import { Licenses } from "./license/Licenses";
import { Dash } from "../general_compo/Dash";
import { WatchUsers } from "./watch_users/WatchUsers";
import { DutyUsers } from "./duty_user/DutyUsers";
import { ReusableAdding } from "../general_compo/ReusableAdding";
import { Questions } from "./question/Questions";

export const Admin = () => {
  return (
    <div>
      <Routes>
        {/* ======================  داشبورد  ======================== */}
        <Route path="/" element={<Dash namePage={<MainPage />} />} />

        {/* ================= مدیریت گروه محصول ===================== */}
        <Route
          path="/product-group-management"
          element={<Dash namePage={<ProductGroupManagement />} />}
        />
        <Route path="/adding-items" element={<ReusableAdding />} />

        {/* ===================  مدیریت محصول ======================== */}
        <Route
          path="/product-management"
          element={<Dash namePage={<ProductManagement />} />}
        />
        <Route path="/adding-items" element={<ReusableAdding />} />

        {/* ===================  مدیریت برندها   ===================== */}
        <Route
          path="/brand-management"
          element={<Dash namePage={<BrandsManagement />} />}
        />
        <Route path="/adding-items" element={<ReusableAdding />} />

        {/* ==================  مدیریت گارانتی ها  ================== */}
        <Route
          path="/guarantee-management"
          element={<Dash namePage={<GuaranteeManagement />} />}
        />
        <Route path="/adding-items" element={<ReusableAdding />} />

        {/* ==================  مدیریت رنگ ها  ====================== */}
        <Route
          path="/colour-management"
          element={<Dash namePage={<ColourManagement />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* ==================  مدیریت تخفیف ها  ==================== */}
        <Route
          path="/discount-management"
          element={<Dash namePage={<DiscountManagement />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* ==================  مدیریت سبد ها  ====================== */}
        <Route
          path="/card-management"
          element={<Dash namePage={<CardsManagement />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* ==================  مدیریت سفارشات  ==================== */}
        <Route
          path="/order-management"
          element={<Dash namePage={<OrdersManagement />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* =================  مدیریت نحوه ارسال ================== */}
        <Route
          path="/send-management"
          element={<Dash namePage={<SendManagement />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />
        {/* =================   مشاهده کاربران  ================== */}
        <Route
          path="/watch-user"
          element={<Dash namePage={<WatchUsers />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* ==================    نقش ها   ======================= */}
        <Route
          path="/duty-user"
          element={<Dash namePage={<DutyUsers />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* ==================    مجوز ها   ====================== */}
        <Route
          path="/license"
          element={<Dash namePage={<Licenses />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* ==================    سوالات    ======================= */}
        <Route
          path="/question"
          element={<Dash namePage={<Questions />} />}
        />
        <Route path="/add-colour" element={<AddColour />} />

        {/* ====================================================== */}

        <Route path="*" element={<Dash namePage={<MainPage />} />} />
      </Routes>
    </div>
  );
};
